import './Navbar.module.css'

let s = {
    'nav': 'Navbar_nav__Wjaxw',
    'item': 'Navbar_item__rH\+Nw'
};


function Navbar () {
    return (
        <nav className={s.nav}>
        <div className={s.item}>
          <a href='#'>Profile</a>
        </div>
        <div className={s.item}>
          <a href='#'>Message</a>
        </div>
        <div className={s.item}>
          <a href='#'>News</a>
        </div>
        <div className={s.item}>
          <a href='#'>Music</a>
        </div>
        <div className={s.item}>
          <a href='#'>Settings</a>
        </div>
      </nav>
    )
};


export default Navbar;
